import React from 'react';
import styles from './MetricCard.module.css';

const MetricCard = ({ title, value, change, isPositive, chartSrc }) => {
  return (
    <article className={styles.metricCard}>
      <header className={styles.cardHeader}>
        <h2 className={styles.cardTitle}>{title}</h2>
        <button className={styles.cardOptions} aria-label="Card options">
          <img src="https://cdn.builder.io/api/v1/image/assets/TEMP/d94aa5d75fd5d4ceb807689472a0ea247e224e092bef799815eca61a33b47f3d?placeholderIfAbsent=true&apiKey=d228bf11a92f469d868c0952327415ff" alt="" />
        </button>
      </header>
      <div className={styles.cardContent}>
        <div className={styles.metricInfo}>
          <p className={styles.metricValue}>{value}</p>
          <div className={styles.metricChange}>
            <span className={`${styles.changeIndicator} ${isPositive ? styles.positive : styles.negative}`}>
              <img src={isPositive ? 'https://cdn.builder.io/api/v1/image/assets/TEMP/6edf37cc05e792e1814f95a3d0cc350bd4026626f991fe045cd8b2a03ff29df1?placeholderIfAbsent=true&apiKey=d228bf11a92f469d868c0952327415ff' : 'https://cdn.builder.io/api/v1/image/assets/TEMP/dd8b7024b7a14c0538f11ccfa464e126921cb603622fca87045f3e7081d67080?placeholderIfAbsent=true&apiKey=d228bf11a92f469d868c0952327415ff'} alt="" />
              {change}
            </span>
            <span className={styles.changeText}>vs last month</span>
          </div>
        </div>
        <img src={chartSrc} alt="" className={styles.chart} />
      </div>
    </article>
  );
};

export default MetricCard;
